import React, { useEffect, useState } from 'react';

interface ResponseData {
  control_ctr: number;
  p_value: number | null;
  status: string;
  variant_ctr: number;
  winner: string;
  control_total_clicks: number;
  variant_total_clicks: number;
  control_total_impressions: number;
  variant_total_impressions: number;
}

const TestResults: React.FC = () => {
  const [responseData, setResponseData] = useState<ResponseData | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/calculate_ab_test_winner?test_id=123');
        const data = await response.json();
        setResponseData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container">
      {responseData ? (
        <div>
          <h1>AB Test Results</h1>
          <table className="result-table">
            <thead>
              <tr>
                <th></th>
                <th>Control</th>
                <th>Variant</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>CTR</td>
                <td>{responseData.control_ctr}</td>
                <td>{responseData.variant_ctr}</td>
              </tr>
              <tr>
                <td>Total Clicks</td>
                <td>{responseData.control_total_clicks}</td>
                <td>{responseData.variant_total_clicks}</td>
              </tr>
              <tr>
                <td>Total Impressions</td>
                <td>{responseData.control_total_impressions}</td>
                <td>{responseData.variant_total_impressions}</td>
              </tr>
            </tbody>
          </table>
          <p>P-value: {responseData.p_value}</p>
          <p>Winner: {responseData.winner}</p>
          <p>Status: {responseData.status}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default TestResults;
